import React, { useEffect, useState } from "react";
import axios from "axios";

const ConsultaRotas = () => {
  const [rotas, setRotas] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5283/api/rotas")
      .then((response) => setRotas(response.data))
      .catch((error) => console.error("Erro ao carregar rotas:", error));
  }, []);

  return (
    <div className="consulta-rotas">
      <h1>Rotas Registradas</h1>
      <ul>
        {rotas.map((rota, index) => (
          <li key={index}>
            {rota.origem} - {rota.destino}: ${rota.valor}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ConsultaRotas;
